import React from "react";
import students from "../data/students";

export default function Upskill() {
  const student = students[0];
  return (
    <section className="max-w-3xl mx-auto py-10">
      <h2 className="text-3xl font-bold mb-4 text-blue-900">Upskill Recommendations</h2>
      <p className="mb-4 text-blue-700">Hi {student.name}, here are personalized suggestions for you:</p>
      <ul className="list-disc list-inside text-lg">
        {student.upskill_suggestions.map((s, idx) => (
          <li key={idx} className="mb-2">{s}</li>
        ))}
      </ul>
    </section>
  );
}
